// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
contract SushiPool {

    struct User {
        uint256 stakeNumber;
        uint256 stakeTime;
        uint256 insert;
        uint256 ru;
    }

    mapping(address => User) public users;

    // 总质押量
    uint256 public stakeTotal;
    // 每秒产出
    uint256 public output;
    // 每秒每个代币产出收益
    uint256 public rn;
    // 用户上次质押时间
    uint256 public lastStakeTime;

    constructor(uint256 _output) {
        output = _output;
        // 上次质押时间  等于矿池部署时间
        lastStakeTime = block.timestamp;
    }

    /**
     * 用户质押 
     * amount 质押数量
     */
    function stake(uint256 _amount) external {
        User storage user = users[msg.sender];
        uint256 secondOutPut;
        if (stakeTotal != 0) {
            secondOutPut = output / stakeTotal;
        }
        rn += (block.timestamp - lastStakeTime) * secondOutPut;

        user.insert +=  (rn - user.ru) * user.stakeNumber;
        user.ru = rn;
        user.stakeNumber += _amount;
        user.stakeTime = block.timestamp;
        stakeTotal += _amount;
        lastStakeTime = block.timestamp;

    }





}

